function rand(e){var t=Math.floor(Math.random()*e+0);return t}function FireFly(e,t,n,r){this.id=e;this.time=r;this.current=function(){var e=document.getElementById(this.id);if(!e){alert("There is no element where the id="+this.id);return false}var t=$(e).css("top");var n=$(e).css("left");var r=[];r.push(t);r.push(n);return r};this.run=function(e){var t=document.getElementById(this.id);if(!t){alert("There is no element where the id="+this.id);return false}if(e==null){return false}else{return $(t).animate({top:e[0],left:e[1]},this.time)}}}function Node(e,t,n){this.top=e;this.left=t;this.points=function(){var e=[];e.push(this.top);e.push(this.left);return e};this.destPoints=n}function Outside(e,t,n){this.top=e;this.left=t;this.points=function(){var e=[];e.push(this.top);e.push(this.left);return e};this.destPoints=n}function FireFlyRun(e,t,n){this.isNode=function(){for(i=0;i<t.length;i++){if(e.current()[0]==t[i].points()[0]&&e.current()[1]==t[i].points()[1]){return true}}return false};this.getNode=function(){for(i=0;i<t.length;i++){if(e.current()[0]==t[i].points()[0]&&e.current()[1]==t[i].points()[1]){return i}}};this.getNodesDestPointsNr=function(e){for(i=0;i<t.length;i++){if(i==e){return t[i].destPoints.length}}};this.getOutside=function(){for(i=0;i<n.length;i++){if(e.current()[0]==n[i].points()[0]&&e.current()[1]==n[i].points()[1]){return i}}};this.getOutsideDestPoints=function(e){for(i=0;i<n.length;i++){if(i==e){return n[i].destPoints}}};this.update=function(t){e.run(t);console.log("works3")};this.draw=function(){var e=[];console.log("works2");if(this.isNode()){var n=this.getNode();var r=rand(this.getNodesDestPointsNr(n));e.push(t[n].destPoints[r][0]);e.push(t[n].destPoints[r][1])}else{var i=this.getOutside();e=this.getOutsideDestPoints(i)}return e};this.run=function(){this.update(this.draw())}}Array.prototype.randomElement=function(){return this[Math.floor(Math.random()*this.length)]}